// App.js

import React from 'react';
import { withScriptjs, withGoogleMap, GoogleMap, Marker } from 'react-google-maps';

function Map() {
  return (
    <GoogleMap
      defaultZoom={8}
      defaultCenter={{ lat: 44.7866, lng: 20.4489 }} // Centar mape (Beograd)
    >
      {/* Markeri za sportske centre */}
      <Marker position={{ lat: 44.7866, lng: 20.4489 }} /> {/* Primer markera */}
      {/* Dodajte više markera za različite sportske centre */}
    </GoogleMap>
  );
}

const WrappedMap = withScriptjs(withGoogleMap(Map));

function AboutUs() {
  return (
    <div className="about-us">
      <div className="about-us-content">
        <h1>O nama</h1>
        <p>
          Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sed vestibulum turpis ac ex
          fringilla posuere. Quisque quis semper mauris. Nullam nec consequat libero. Donec
          elementum velit vel justo eleifend, vel accumsan justo congue.
        </p>
        {/* Dodajte više teksta o vašem fitnesu ovde */}

        <div style={{ width: '100%', height: '400px' }}>
          <WrappedMap
            googleMapURL={`https://maps.googleapis.com/maps/api/js?key=TVOJ_API_KLJUC&libraries=places`}
            loadingElement={<div style={{ height: `100%` }} />}
            containerElement={<div style={{ height: `100%` }} />}
            mapElement={<div style={{ height: `100%` }} />}
          />
        </div>
      </div>
    </div>
  );
}

export default AboutUs;
